how_many = 999
# Open SQL file for writing
with open('records_999.sql', 'w') as f:
    f.write("BEGIN TRANSACTION;\n")
    current_timestamp = 1083367429
    for d in range(how_many):
        current_timestamp = current_timestamp+d
        record_id = uuid.uuid4()
        values = (
            str(record_id),
            'note/lexical',
            body,
            current_timestamp
        )
        sql = "INSERT INTO records_write (id, mime_type, body, created_at) VALUES ('%s','%s','%s',%d);\n" % values
        f.write(sql)
    f.write("COMMIT;\n")
